import jsPDF from "jspdf";

export function generateInvoicePDF(invoice) {
  const doc = new jsPDF();

  // Logo desde archivo local
  const logoBase64 = "data:image/jpg;base64,"; // Base64 de la imagen
doc.addImage(logoBase64, "PNG", 10, 10, 30, 30);


  // Título
  doc.setFont("helvetica", "bolditalic");
  doc.setTextColor(178,173, 172);
  doc.setFontSize(25);
  doc.text("Factura", 170, 20, { align: "right" });

  doc.setTextColor(0, 0, 0);
  // Información de la empresa
  let yy = 45
  doc.setFont("helvetica", "normal");
  doc.setFontSize(10);
  doc.text("Handbol Sant Joan", 10, yy);
  yy += 5
  doc.text("21481640M", 10, yy);
  yy += 5
  doc.text("Calle San Antonia, S/N", 10, yy);
  yy += 5
  doc.text("03550 Sant Joan d'Alacant", 10, yy);
  yy += 5
  doc.text("handbolsantjoan@gmail.com", 10, yy);

  // Información del cliente

  // Dibujar la caja
  // Dimensiones de la caja
  const boxX = 120; // Posición X de la caja
  const boxY = 30; // Posición Y de la caja
  const boxWidth = 80; // Ancho de la caja
  const boxHeight = 40; // Altura de la caja
  const lineHeight = 6; // Altura de cada línea
  let currentY = boxY + 6; // Posición Y inicial dentro de la caja

  // Dibujar la caja
  doc.rect(boxX, boxY, boxWidth, boxHeight);

  // Título de la caja
  doc.setFont("helvetica", "bold");
  doc.text("Datos del Cliente", boxX + 5, currentY);
  currentY += lineHeight + 2; // Ajustar espacio después del título

  // Añadir datos del cliente con ajuste de texto
  doc.setFont("helvetica", "normal");
  const clientDetails = [
    `Nombre: ${invoice.client_name}`,
    `Dirección: ${invoice.client_address}`,
    `N.I.F.: ${invoice.client_nif}`
  ];

  clientDetails.forEach((detail) => {
    const lines = doc.splitTextToSize(detail, boxWidth - 10); // Ajustar texto al ancho de la caja
    lines.forEach((line) => {
      if (currentY + lineHeight <= boxY + boxHeight) {
        // Escribir línea solo si cabe dentro de la caja
        doc.text(line, boxX + 5, currentY);
        currentY += lineHeight; // Avanzar la posición Y
      }
    });
  });

  // Información de la factura
  yy += 10
  doc.text(`Número: ${invoice.number}`, 10, yy);
  const fechaBD = invoice.date;
  const fecha = new Date(fechaBD);
  const fechaFormateada = fecha.toLocaleDateString("es-ES", {
  day: "2-digit",
  month: "2-digit",
  year: "numeric"
});
  doc.text(`Fecha: ${fechaFormateada}`, 60, yy);

  // Tabla de conceptos
  doc.setFont("helvetica", "bold");
  doc.text("Descripción", 40, 100);
  doc.text("Cantidad", 110, 100);
  doc.text("Precio", 140, 100);
  doc.text("Dto.", 160, 100);
  doc.text("Importe", 180, 100, { align: "right" });

  // Líneas de la factura
  doc.setFont("helvetica", "normal");
  let y = 110;
  invoice.items.forEach((item) => {
    const description = doc.splitTextToSize(item.description, 100);
    doc.text(description, 25, y);
    doc.text(item.quantity.toString(), 130, y, { align: "right" });
    doc.text((item.price).toFixed(2), 150, y, { align: "right" });
    doc.text((item.amount / 100).toFixed(2), 170, y, { align: "right" });
    y += 10 * Math.max(description.length, 1);
  });

  // Totales
  y += 10;
  doc.line(10, y, 200, y);
  y += 10;
  doc.text("Base Imponible:", 130, y);
  doc.text(`${(invoice.subtotal / 100).toFixed(2)} €`, 170, y, { align: "right" });

  y += 10;
  doc.text(`IVA (${invoice.tax_rate}%):`, 140, y);
  doc.text(`${(invoice.tax_amount / 100).toFixed(2)} €`, 170, y, { align: "right" });

  y += 10;
  doc.setFont("helvetica", "bold");
  doc.text("TOTAL:", 140, y);
  doc.text(`${(invoice.total / 100).toFixed(2)} €`, 170, y, { align: "right" });

  // Guardar PDF
  doc.save(`factura-${invoice.number}.pdf`);
}
